import React from 'react';
import './Home.css';

const Home = () => {
  return (
    <div className="home-container">
      <h1 className="home-title">Welcome to GlaHarn</h1>
      <button className="home-button">Check Bill Now</button>
      <button className="home-button">Make Event</button>
      <button className="home-button">Status Debtor</button>
    </div>
  );
};

export default Home;
